import React, { Component } from "react";
import classes from "./table.module.css";
class Table extends Component {
  render() {
    console.log(this.state.id);
    const data = this.props.data;
    return (
      <tr className={classes.table}>
        <td>{data[0]}</td>
        <td>{data[1]}</td>
        <td>{data[2]}</td>
        <td>{data[3]}</td>
      </tr>
    );
  }
}

export default Table;
